webpackJsonp([0xddabeb6dcb17],{990:function(e,r){e.exports={data:{site:{siteMetadata:{title:"Nobody Listens Anyway",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2011-06-28-brew-install-mysql-issue/index.md absPath of file >>> MarkdownRemark",html:"<p>I ran into a problem while trying to install mysql using homebrew:</p>\n<pre><code>~/projects/oerglue (master)$ brew install mysql\n==> Downloading http://downloads.mysql.com/archives/mysql-5.5/mysql-5.5.12.tar.gz\ncurl: (7) couldn't connect to host\nError: Failure while executing: /usr/bin/curl -f#LA Homebrew 0.8 (Ruby 1.8.7-174; Mac OS X 10.6.8) http://downloads.mysql.com/archives/mysql-5.5/mysql-5.5.12.tar.gz -o /Users/jbasdf/Library/Caches/Homebrew/mysql-5.5.12.tar.gz\n</code></pre>\n<p>Basically, the script couldn't find the mysql source code.</p>\n<p>Luckily homebrew uses ruby. So fixing the problem was really easy. Just edit the mysql.rb homebrew formula found here:</p>\n<p>/usr/local/Library/Formula/mysql.rb</p>\n<p>I just changed the url and md5 like so:</p>\n<pre><code>url 'http://mirror.services.wisc.edu/mysql/Downloads/MySQL-5.5/mysql-5.5.13.tar.gz'\nmd5 'f0e519e90ee7c00fceb0730edf859d7b'\n</code></pre>\n<p>Then everything worked great. One note, if you want to change the version or use a different mirror for mysql be sure to get the 'Source Code' version of mysql not the Mac version. You can select the platform using the dropdown on the downloads page -</p>",frontmatter:{title:"Brew Install MySQL Issue",date:"June 28, 2011",image:null}}},pathContext:{path:"/brew-install-mysql-issue"}}}});
